webpackJsonp([36306602139293],{387:function(A,e){A.exports={data:{contentfulBlogPost:{title:"Jesus Gets It",createdAt:"February 19, 2018",featuredImage:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=800&q=50",srcSet:"//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=200&h=133&q=50 200w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=400&h=267&q=50 400w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=800&h=533&q=50 800w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=1053&h=702&q=50 1053w",srcWebp:"//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=800&q=50&fm=webp",srcSetWebp:"//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=200&h=133&q=50&fm=webp 200w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=400&h=267&q=50&fm=webp 400w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=800&h=533&q=50&fm=webp 800w,\n//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg?w=1053&h=702&q=50&fm=webp 1053w",sizes:"(max-width: 800px) 100vw, 800px"},id:"c6uJelEjMzuaKi2eKCaywkK",file:{url:"//images.ctfassets.net/t8j0ewtik3c3/6uJelEjMzuaKi2eKCaywkK/bf8e90962701acda5f785ee00663cefd/download.jpg",fileName:"download.jpg",contentType:"image/jpeg"}},content:{childMarkdownRemark:{html:"<p>I haven't written anything in a couple months because I've been tired, stressed, busy, a combination of all those things. Just dealing with life. And a new dog (he is super cute). And a new school year. And laundry.</p>\n<p>I sometimes forget or neglect to sit down and think about things when I get so wrapped up in life. That's exactly what I needed to do: write, reflect, breathe, share.</p>\n<p>I'm slightly mad at myself for putting these things off for the past two months but Jesus gets it. He understands. He was there.</p>\n<p>I've been (very slowly) reading my way through a <a href=\"http://sheilawalsh.com/\">Sheila Walsh</a> book titled \"God Loves Broken People (And Those Who Pretend They're Not)\". Every page is juicy and makes me want to share it. I have little bookmarks and folded corners all over the book. Sheila admits she's broken and helps us see that we are too. She strongly emphasizes how the darkness in our souls can open us to the intimacy and love of Jesus we might not have known otherwise. Jesus suffered, he shares in our suffering.</p>\n<p>\"When Jesus saw her weeping, and the Jews who had come with her also weeping, he was deeply moved in his spirit and greatly troubled,\" John 11:33</p>\n<p>Sheila explains the word 'moved' here is translated from the Greek word 'embrimaomai'. That word is strong and represents anger, strength, or the bellowing and snorting of a horse. Some might say fury. Christ was feeling fury at the pain Mary and Martha were feeling in this situation. She points out that Christ rages with us.</p>\n<p>How differently would we experience pain if we truly understood that Jesus feels with us?</p>\n<p>I've been trying to reflect on that over the weekend. I was feeling anxious: Jesus gets it. I was frustrated: Jesus gets it. Jesus was the master of <a href=\"http://abovethebattle.com/the-beginning/\">rising above the battle.</a></p>\n<p>God never promised us an easy journey but He did promise us He wins in the end (John 16:33).</p>\n<p>When we're feeling lost, depressed, anxious, terrified, angry... let's take a moment to remember Jesus gets it. The God of the universe hears you, understands you.</p>"}}}},pathContext:{slug:"jesus-gets-it"}}}});
